                            "content": "PARENTS OFTEN {{fret||fret||**v. 烦恼** `frɛt` *(fret about)* be constantly or visibly worried or anxious||语源“吞噬”: ***fret*** (eat) + ***-t*** (forming v.)}} about whether they are doing their jobs properly. Take too hands-off an approach and the kids will grow up {{feral||feral||**adj. 野性的** `ˈfɛrəl` in a wild state, especially after escape from captivity or domestication||语源“野兽”: ***fer*** (wild) + ***-al*** (forming adj.)||***fer*** (wild) → **fer**ocious (凶猛的)}}. {{Smother||Smother||**v. 窒息** `ˈsmʌðə` kill (someone) by covering their nose and mouth so that they suffocate||语源“烟”: ***smother*** (smoke)}} them with attention, though, and the risk is of raising offspring unable to function on their own.\n\nEvolution, it seems, faces similar {{trade-offs||trade-off||**n. 权衡** `ˈtreɪdɒf` a situation in which you accept something bad in order to have something good}}. In a paper published in {{Proceedings||Proceedings||**n. 会报** `prəˈsiːdɪŋz` a published report of the papers delivered at a meeting of a learned society or other association||语源“向前走”: ***pro-*** (forward) + ***ceed*** (go) + ***-ing*** (forming n.)||***pro-*** (forward) → **pro**gress (进步), **pro**ceed (继续); ***ceed*** (go) → suc**ceed** (成功), ex**ceed** (超出)}} of the Royal Society B on May 24th, Rahia Mashoodh and Rebecca Kilner, a pair of biologists at the University of Cambridge, offer an explanation for a {{curious||curious||**adj. 奇怪的** `ˈkjʊərɪəs` strange and unusual||语源“想知道的”: ***cur*** (care) + ***-ious*** (forming adj.)||***cur*** (care) → **cur**e (治愈), **cur**ator (策展人)}} fact: once a species has evolved to care for its young, the trait is almost never lost again. They argue that parental {{pampering||pamper||**v. 溺爱** `ˈpæmpə` indulge with every attention, comfort, and kindness; spoil||语源“塞满”: ***pamper*** (stuff)}} comes with a genetic price that makes returning to the {{status quo ante||status quo ante||**phr. 原状** the previously existing state of affairs}}.\n\nThe price in question is {{mutations||mutation||**n. 突变** `mjuːˈteɪʃən` the action or process of changing in structure or form||语源“改变”: ***mut*** (change) + ***-ation*** (forming n.)||***mut*** (change) → **mut**able (易变的), com**mute** (通勤)}}—random changes in an organism’s genome. Some are seriously harmful, and quickly {{weeded out||weed out||**phr. 剔除** remove (an inferior or unwanted person or thing) from a group}}. But many are only mildly {{deleterious||deleterious||**adj. 有害的** `ˌdɛlɪˈtɪərɪəs` causing harm or damage||语源“有害的”: ***delete*** (destroy) + ***-ious*** (forming adj.)}}. and do not much {{hamper||hamper||**v. 阻碍** `ˈhæmpə` hinder or impede the movement or progress of||语源“束缚”: ***hamper*** (bind)}} an individual’s chances of reproducing as long as conditions are good. With that in mind, researchers have long {{speculated||speculate||**v. 推测** `ˈspɛkjʊleɪt` form a theory or conjecture about a subject without firm evidence||语源“观察”: ***spec*** (look) + ***-ulate*** (forming v.)||***spec*** (look) → **spec**tacle (景象), **spec**tator (观众)}} that {{doting||dote||**v. 溺爱** `dəʊt` *(dote on)* be extremely fond of; adore||语源“愚蠢”: ***dote*** (foolish)}} parents provide exactly the sorts of pleasant environment that allow offspring with mildly damaging mutations to survive when they otherwise would not.\n\nTesting the theory requires tracking species over many generations. That is tricky, for many species that provide parental care are irritatingly {{long-lived||long-lived||**adj. 长寿的** living or lasting for a long time}}. Dr Mashoodh and Dr Kilner turned to the burying beetle, which combines parental care with a relatively short lifespan. The beetles breed in the corpses of small mammals and birds, turning them into carefully {{tended||tend||**v. 照料** `tɛnd` care for or look after; manage||语源“伸展”: ***tend*** (stretch) + ***-d*** (forming v.)||***tend*** (stretch) → ex**tend** (延伸), in**tend** (打算)}} nests and regularly spraying them with {{disinfectant||disinfectant||**n. 消毒剂** `ˌdɪsɪnˈfɛktənt` a chemical liquid that destroys bacteria||语源“去除感染”: ***dis-*** (away) + ***infect*** (infect) + ***-ant*** (forming n.)||***dis-*** (away) → **dis**miss (解散), **dis**agree (不同意); ***infect*** (infect) → **infect**ion (感染)}} chemicals to keep them clear of bothersome {{pathogens||pathogen||**n. 病原体** `ˈpaθədʒən` a bacterium, virus, or other microorganism that can cause disease||语源“产生疾病”: ***patho-*** (disease) + ***-gen*** (produce)||***patho-*** (disease) → **patho**logy (病理学); ***gen*** (produce) → **gen**erate (产生), **gen**etic (基因的)}}. When their young hatch, the parents protect them from predators and feed them bits of the {{carcass||carcass||**n. 尸体** `ˈkɑːkəs` the dead body of an animal||语源“肉体”: ***carcass*** (flesh)}}.\n\nThe researchers set up two populations. In one, beetles were raised by doting parents. In the other, beetles hatched out of eggs near a dead mouse but had no parents to make life easier. This split was maintained for 20 generations.\n\nDrs Mashoodh and Dr Kilner then {{inbred||inbreed||**v. 近亲繁殖** `ɪnˈbriːd` breed from closely related people or animals, especially over several generations||语源“内部繁殖”: ***in-*** (in) + ***breed*** (breed)}} the resulting descendants. Inbreeding {{amplifies||amplify||**v. 放大** `ˈæmplɪfaɪ` increase the volume of (sound), especially using an amplifier||语源“使宽广”: ***ampl*** (wide) + ***-ify*** (forming v., ……化, 表状态改变)||***ampl*** (wide) → **ampl**e (充足的)}} damaging mutations, and often results in extinction. But the rate at which inbreeding drives a species off the evolutionary {{cliff||cliff||**n. 悬崖** `klɪf` a steep rock face, especially at the edge of the sea}} varies with how many damaging mutations are present in the first place.\n\nThe population of beetles whose ancestors had been pampered by their parents died out in just two generations of inbreeding. By contrast, beetles that had a history of surviving alone {{endured||endure||**v. 持续** `ɪnˈdjʊə` last over a period of time; remain in existence||语源“使坚硬”: ***en-*** (in, forming v.) + ***dur*** (hard) + ***-e*** (forming v.)||***dur*** (hard) → **dur**able (耐用的), **dur**ation (持续时间)}} for four. That strongly suggests that the {{hatchlings||hatchling||**n. 刚孵出的动物** `ˈhætʃlɪŋ` a young animal that has just hatched from its egg}} denied parental care over the course of many generations ended up with considerably healthier genomes than those that had been looked after by mum and dad.\n\nParental care, in other words, is a one-way evolutionary street because it generates a problem that only it can solve. That makes going backwards hard. But it is not all bad news. Although most mutations are harmful, the researchers point out that a few are helpful. They speculate that a species full of {{helicopter parents||helicopter parent||**n. 直升机父母** a parent who takes an overprotective or excessive interest in the life of their child or children}} might expose its young to more of the evolutionary bad—but also more of the good.",
